import React,{Component} from 'react'
import propType from 'prop-types'
import './App.css'

export class App extends Component{
    render(props) {
        return(
            <h1 className='name'> Hai Hello , {this.props.name}</h1>
        )
    }
}

App.defaultProps = {
    name:"Maaz"
};
App.propType = {
    name: ReactPropTypes.string.isRequired
}
